INSERT INTO `articles` (`id`, `category_id`, `title`, `image_path`, `description`, `content`, `created_time`) VALUES
(21, 3, '[Обзор] Millennia — создавая историю ход за ходом, эпоха за эпохой, от зари человечества до космических далей за 10 000 лет.', '1716806251088-1111.gif', 'Представляем вам Millennia - захватывающую пошаговую стратегию, созданную студией C Prompt Games и изданную Paradox Interactive 26 марта 2024 года. Вдохновленная Sid Meier\'s Civilization, Millennia дарит вам возможность провести свою цивилизацию сквозь тысячелетия, от зарождения в каменном веке до покорения космических вершин.', '<p><span style=\"background-color: rgb(35, 35, 36); color: rgb(201, 204, 207);\">Поклонники Civilization сразу же узнают знакомую механику, но не спешите называть Millennia клоном. Игра бережно сохраняет традиции жанра, но при этом вводит множество свежих идей и инноваций, делающих ее уникальной и захватывающей. Так давайте же погрузимся с вами в мир Millennia и узнаем, что же таит в себе эта новая игра!</span></p><p><br></p><h2><span style=\"background-color: rgb(35, 35, 36); color: rgb(201, 204, 207);\">Начало игры и Исследования технологий / Эпохи</span></h2><p><span style=\"background-color: rgb(35, 35, 36); color: rgb(201, 204, 207);\">Игра начинается с выбора страны, за которую вы будете править. В отличие от Civilization, где выбор страны предопределяет ваши стартовые преимущества, здесь он не дает прямых игровых бонусов, но служит лишь больше для кастомизации.</span></p><p><span style=\"background-color: rgb(35, 35, 36); color: rgb(201, 204, 207);\">Вместо этого вы можете вручную выбрать стартовый бонус, который может совпадать у разных игроков. Существует множество различных бонусов на выбор, каждый из которых может дать вам уникальное преимущество в начале игры. Тщательный выбор стартового бонуса может сильно зарешать, так например, дополнительный разведчик - может помочь найти все достопримечательности и дикие племена первым.</span></p><p><br></p><p><img src=\"data:image/png;base64,\"></p><p><br></p><p><span style=\"background-color: rgb(35, 35, 36); color: rgb(201, 204, 207);\">И вот, игра началась! Вместо привычных поселенцев и выбора места под город, вас встретит уже построенный город и два юнита, если не выбрано стартового бонуса на дополнительного воина или разведчика. Местоположение поселения предопределено, и иногда это повод, чтобы слегка приуныть!</span></p><p><br></p><p><img src=\"data:image/png;base64,\"></p><p><span style=\"background-color: rgb(35, 35, 36); color: rgb(201, 204, 207);\">В&nbsp;</span><strong style=\"background-color: rgb(35, 35, 36); color: rgb(201, 204, 207);\">Millennia</strong><span style=\"background-color: rgb(35, 35, 36); color: rgb(201, 204, 207);\">&nbsp;вы не ограничены утомительными древовидными системами исследований. Вы можете выбирать любые технологии, доступные в текущую эпоху, и прокладывать свой уникальный путь к процветанию.</span></p><p><strong style=\"background-color: rgb(35, 35, 36); color: rgb(201, 204, 207);\">Но помните</strong><span style=\"background-color: rgb(35, 35, 36); color: rgb(201, 204, 207);\">: путь к новой эре не ограничен одним-единственным вариантом. Выберите стандартный переход, изучив необходимое количество технологий предыдущей эпохи, или выполните дополнительные условия для открытия продвинутого варианта.</span></p><p><br></p><p><br></p><p><br></p>', '2024-05-27 10:37:31');
INSERT INTO `articles` (`id`, `category_id`, `title`, `image_path`, `description`, `content`, `created_time`) VALUES
(22, 3, 'Теккен 8, Лидия Собеска', '1716806393615-8rFdL03U3jsadOQksTmcew.jpeg', 'На прошедшем вчера турнире Комбобрейкер 2024 показали геймплей DLC персонажа Лидии Собески. Это летний персонаж, который является вторым из четырех персонажей первого сезона. Первым был Эдди, он вышел в апреле.', '<iframe class=\"ql-video\" frameborder=\"0\" allowfullscreen=\"true\" src=\"https://www.youtube.com/embed/wapN3UqjJmI?showinfo=0\"></iframe><p><br></p><p><span style=\"background-color: rgb(35, 35, 36); color: rgb(201, 204, 207);\">Геймплей польской каратистки-шотокан претерпел немного изменений. Это по-прежнему гибридный персонаж, сочетающий в себе нейтральную игру и миксапы из стоек. Как и ожидали фанаты, новая система жары усилила стойки персонажа. Теперь Лидии в усиленном состоянии доступны новые серии из стоек и парирование. Есть новые особые анимации при переходах в стойку. Есть предположение, что некоторые выходы в стойки будут доступны за дополнительный метр, от чего будет воспроизводиться новая анимация.</span></p><p><span style=\"background-color: rgb(35, 35, 36); color: rgb(201, 204, 207);\">Лидия Собеска была последним DLC персонажем в Теккен 7. Она появилась в игре в феврале 2021 года. С тех пор фанаты ожидали ее в стартовом ростере Теккен 8. Однако разработчики снова поместили ее в дополнительный контент, который необходимо приобретать отдельно.</span></p><p><img src=\"data:image/png;base64,\"></p><p><span style=\"background-color: rgb(35, 35, 36); color: rgb(201, 204, 207);\">Дата релиза Лидии в Теккен 8 не объявлена. Скорей всего ее выпустят в Июне, чтобы у игроков было время изучить ее перед летним турниром EVO 2024.</span></p>', '2024-05-27 10:39:53');
INSERT INTO `articles` (`id`, `category_id`, `title`, `image_path`, `description`, `content`, `created_time`) VALUES
(23, 2, 'Посмотрел фильм «Министерство неджентльменских дел» Гая Ричи', '1716806569852-MOUGW-06894-R-rgb-copy-65c25b5fcd1bf.jpg', 'Мне кажется, что только слепой не заметит того факта, что современный Ричи забил на качество, сделав упор на количество, что очень отчетливо видно в его нынешних проектах, где в каждом новом фильме просадки во многих аспектах становятся заметнее и заметнее, особенно страдали сценарии. Но тут Ричи переиграл сам себя и выдал худший свой фильм со времен «Унесенных».', '<p><img src=\"data:image/png;base64,\"></p><p><br></p><p><span style=\"background-color: rgb(35, 35, 36); color: rgb(201, 204, 207);\">Новый фильм Гая Ричи «Министерство неджентльменских дел» основан на документальной книге Дэмиена Льюиса «Министерство неджентльменской войны» 2014 года, она рассказывает о засекреченной деятельности Управления специальных операций, созданного Уинстоном Черчиллем в 1942 году. Несмотря на интересную историческую основу и наличие реальных фактов, фильм страдает от многочисленных проблем с художественной точки зрения.</span></p><p><img src=\"data:image/png;base64,\"></p><p><br></p><p><span style=\"background-color: rgb(35, 35, 36); color: rgb(201, 204, 207);\">«Министерство неджентльменских дел» представляет собой очередную попытку режиссера создать ироничный и комичный боевик, в котором он продолжает использовать знакомые мотивы и штампы своих предыдущих работ. В картине много персонажей, типичных для Гая Ричи, но в этом фильме они не работают должным образом из-за выбранного сеттинга, который должен был стать основой для серьёзной исторической драмы, да и режиссура самого Ричи не подходит для такого проекта, что подчёркивается абсурдными и неинтересными ситуациями, а также неуместным юмором. А экшен теряется на фоне происходящей клоунады, ну и сами нацисты изображены как карикатурные неумехи, которые никак не могут противостоять непобедимым героям. Эти самые герои легко проникают на вражеские базы и устраивают хаос, при этом не получая никакого сопротивления в ответ.</span></p><p><br></p><p><span style=\"background-color: rgb(35, 35, 36); color: rgb(201, 204, 207);\">Видно, что Ричи изначально не стремился создать серьезную историческую драму, вместо этого он сделал оммаж антифашистским авантюрным комедиям, популярным в Голливуде 40-50-х годов. А в итоге у него получится идеальный пример фильма с антисюжетом. Нет конфликта. Нет запоминающихся персонажей. Нет его фирменного юмора. Ни капли напряжения. Ужасные диалоги, которые со временем начинают звучать как бессмысленный набор букв с бесконечными экспозиционными вставками. А экшен ближе к концу превращаются в скучные, однотипные катсцены из какой-нибудь Call of Duty, где NPC бездумно расстреливали главные герои, зачастую даже не глядя. Вот вроде эффектный момент, но в конце тебе уже абсолютно все равно на происходящие на экране.</span></p><p><br></p><p><img src=\"data:image/png;base64,\"></p><p><br></p><p><span style=\"background-color: rgb(35, 35, 36); color: rgb(201, 204, 207);\">В общем, фильм «Министерство неджентльменских дел» стал для меня пиком упадка Гая Ричи как режиссёра. Современный Ричи, похоже, слишком увлёкся погоней за быстрыми деньгами и забыл о том, что делает его фильмы уникальными. В попытке выпускать фильмы чаще он утратил своё прежнее мастерство, и его новая картина это только подтверждает. «Министерство неджентльменских дел» разочаровывает на всех уровнях — от сюжета и персонажей до экшена и диалогов. Но эту конвейерную машину не остановить, и в следующем году выйдет новый фильм Ричи под названием «В серой зоне», да и в разработке у него находится минимум ещё 3 фильма.</span></p>', '2024-05-27 10:42:49');
INSERT INTO `articles` (`id`, `category_id`, `title`, `image_path`, `description`, `content`, `created_time`) VALUES
(24, 2, 'Рецензия на фильм \"Майор Гром: Игра\" (2024)', '1716806741199-347159529554217.jpeg', 'Миллиардер, филантроп и основатель социальной сети Vmeste Сергей Разумовский (Сергей Горошко) устроил самосуд над преступниками и коррупционерами в Санкт-Петербурге. Делал он это под псевдонимом «Чумной Доктор». Полицейский Игорь Гром (Тихон Жизневский) помешал планам злодея, но чуть не потерял свою работу. Разумовский оказался пойманным и был отправлен в психиатрическую лечебницу под надзор доктора Вениамина Рубинштейна (Константин Хабенский).', '<p><span style=\"background-color: rgb(35, 35, 36); color: rgb(201, 204, 207);\">Петербуржцы считают его своим героем: рисуют граффити с его изображением, пытаются копировать его стиль одежды, не дают прохода в ожидании селфи и автографа. На работе коллеги рады работать плечом к плечу с профессионалом, а любимая девушка (Любовь Аксенова) будоражит интернет эксклюзивами о спасителе на Неве.</span></p><p><span style=\"background-color: rgb(35, 35, 36); color: rgb(201, 204, 207);\">Именно в такое счастливое время для Грома происходит реформирование петербургской полиции. Живую силу хотят заменить на высокотехнологичные дроны, которые должны в разы эффективнее патрулировать город. Единственным подрядчиком, который может выполнить подобный заказ, оказывается Август ван дер Хольт (Матвей Лыков) – наследник технологической империи Holt International.</span></p><p><span style=\"background-color: rgb(35, 35, 36); color: rgb(201, 204, 207);\">Приезд Хольта и годовщина победы на Чумным Доктором омрачается чередой терактов в Санкт-Петербурге. Гром находит источник этих оказий, но злодей (Дмитрий Чеботарев) ставит ему ультиматум: или Игорь уходит в отставку, или трагедии в городе продолжатся. Майор оказывается принципиальным и принимает вызов, чем ставит под угрозу жизни множества горожан.</span></p><p><img src=\"data:image/png;base64,\"></p><p><br></p><p><span style=\"background-color: rgb(35, 35, 36); color: rgb(201, 204, 207);\">Уже по вышеизложенному синопсису заметно, что фильм по накалу страстей пытается быть экранизацией одноименной комиксной арки. Только если комикс выходил частями, что роднит его с сериальным форматом, то фильм с продолжительностью в почти три часа пытается наглядно презентовать все возможности уже разросшейся киновселенной Bubble.</span></p><p><span style=\"background-color: rgb(35, 35, 36); color: rgb(201, 204, 207);\">Возникает невольный вопрос: имея такой хронометраж (почти на уровне «Мстители: Финал» (2019)) и множество сюжетных линий, стоит ли оно того? Вопрос спорный. Зрителю, не знающему ни комиксы Bubble, ни предшествующие два фильма в киновселенной, будет сложно включиться в происходящее на киноэкране действие. Для остальных же – это зрелище, где создатели картины устраивают эмоциональные качели: то у Грома все хорошо, то он погружается на моральное дно.</span></p><p><span style=\"background-color: rgb(35, 35, 36); color: rgb(201, 204, 207);\">Подобный прием объясняется довольно просто. В «Майор Гром: Чумной Доктор» (2021) ставились две задачи: познакомить кинозрителя с героем, который хотя и старомоден, но харизматичен и эффективен, но главное – зарядить новую волну интереса к отечественным комиксам, в частности, к Игорю Грому.</span></p><p><br></p><p><img src=\"data:image/png;base64,\"></p><p><br></p><p><span style=\"background-color: rgb(35, 35, 36); color: rgb(201, 204, 207);\">У приквела «Гром: Трудное детство» (2023) задача куда проще – объяснить сложный характер Грома путем демонстрации его личной трагедии из детства.</span></p><p><span style=\"background-color: rgb(35, 35, 36); color: rgb(201, 204, 207);\">Поэтому очевидно, что задача нынешнего фильма подразумевает демонстрацию всех возможностей, чтобы дать мощный импульс к дальнейшим проектам. Например, в этом году на Кинопоиске должен выйти сериал «Фурия», основанный на серии комиксов «Красная Фурия» (кстати, поэтому в «Игру» добавили Хольта, так как именно он является главным антагонистом Фурии по комиксам). Также приквел напрашивается и про психолога Рубинштейна. И хотя у персонажа крайне мало игрового времени, тем не менее Константин Хабенский в каждой сцене демонстрирует свой актерский талант. В комиксах этот персонаж имеет долгую историю с Громом, и на их противостояние также намекнули создатели ленты.</span></p><p><span style=\"background-color: rgb(35, 35, 36); color: rgb(201, 204, 207);\">Главным недостатком «Чумного Доктора» критики называли двоякую трактовку действий и посылов. Из-за этого фильм не добрал своих денег в прокате, но стал популярным на стримингах.</span></p><p><span style=\"background-color: rgb(35, 35, 36); color: rgb(201, 204, 207);\">В «Игре» создатели все же попытались ответить на извечный вопрос о том, что же важнее: мораль или закон? Так журналистка задается вопросом, почему СМИ не называют вещи своими именами, а Гром признает свои ошибки.</span></p><p><br></p><iframe class=\"ql-video\" frameborder=\"0\" allowfullscreen=\"true\" src=\"https://www.youtube.com/embed/Nx-EDQLyo5A?showinfo=0\"></iframe><p><span style=\"background-color: rgb(35, 35, 36); color: rgb(201, 204, 207);\">«Майор Гром: Игра» во всех смыслах вышел неоднозначным. Да, фанаты этой франшизы будут в восторге – в фильме присутствует множество пасхалок, камео и фансервиса. Но происходящее действие можно было сократить, а лучше – разделить на две полноценные части. Герой же, рефлексирующий над жизненной дилеммой пока мир вокруг разрушается – это всегда работающий прием, вне зависимости от национальности, пола и вероисповедания.</span></p>', '2024-05-27 10:45:41');
INSERT INTO `articles` (`id`, `category_id`, `title`, `image_path`, `description`, `content`, `created_time`) VALUES
(25, 5, 'Боксер Мухаммед Али выпускал альбом I’am the Greatest', '1716806975570-I_Am_the_Greatest_(Cassius_Clay_album).jpg', 'Запись состоит, в основном, из монологов и стихов посвященных самому Кассиусу Клэю.\r\nИменно под именем Кассиуса запись былы выпущена в 1963г., за 6 месяцев до принятия им ислама и смены имени на Мухаммеда Али.\r\nОн сотрудничал с комедийным сценаристом Гари Белкиным, который выступил и продюсером этой необычной записи.', '<p><span style=\"background-color: rgb(35, 35, 36); color: rgb(201, 204, 207);\">Заголовок каждого трека начинается со слова Раунд, которых всего 8.Например, Round 5: Will The Real Sonny Liston Please Fall Down можно отнести к прародителям формата рэп-баттла, в котором Али насмехается над одним из своих оппонентов на ринге Сонни Листоном.</span></p><p><span style=\"background-color: rgb(35, 35, 36); color: rgb(201, 204, 207);\">В 1999г выходило&nbsp;</span><a href=\"https://youtube.com/playlist?list=PLl9cMNFDVYaJT-ehiIL6nv4tb7w-HGNqA&amp;si=-xoIzTKSLoivytf2\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"background-color: transparent; color: var(--theme-color-signal-active-default);\">переиздание</a><span style=\"background-color: rgb(35, 35, 36); color: rgb(201, 204, 207);\">&nbsp;этого необычного альбома, включавшее в себя прям настоящую песню The Gangs All Here, где можно услышать пение легендарного боксера.</span></p><p><br></p><iframe class=\"ql-video\" frameborder=\"0\" allowfullscreen=\"true\" src=\"https://www.youtube.com/embed/T1DSwIhEXUk?showinfo=0\"></iframe><p><br></p><p><span style=\"background-color: rgb(35, 35, 36); color: rgb(201, 204, 207);\">С точки зрения самого факта, что известный спортсмен поёт, это стоит послушать хотя бы раз. Представил, как бы мог записать что-то подобное наш современник, например Кличко :)</span></p>', '2024-05-27 10:49:35');
INSERT INTO `articles` (`id`, `category_id`, `title`, `image_path`, `description`, `content`, `created_time`) VALUES
(26, 5, '10 крутых вопросов из «Что? Где? Когда?» про музыку', '1716807218000-22222.gif', 'Попробуйте ответить на все вопросы здесь, а не на этом вашем ЕГЭ.', '<p><span style=\"background-color: rgb(35, 35, 36); color: rgb(201, 204, 207);\">Вопросы как всегда честно украдены из базы спортивного ЧГК.</span></p><p><br></p><h2><span style=\"background-color: rgb(35, 35, 36); color: rgb(201, 204, 207);\">Вопрос №1</span></h2><p><span style=\"background-color: rgb(35, 35, 36); color: rgb(201, 204, 207);\">Посмотрите на график, посвященный произведению 1969 года, снятого по мотивам известного литературного сюжета.</span></p><p><span style=\"background-color: rgb(35, 35, 36); color: rgb(201, 204, 207);\">Какие два слова закрыты в названии этой диаграммы?</span></p><p><img src=\"data:image/png;base64,\"></p><p><br></p><p><strong style=\"background-color: rgb(35, 35, 36); color: rgb(201, 204, 207);\">Ответ:</strong></p><p><span style=\"background-color: rgb(35, 35, 36); color: rgb(201, 204, 207);\">... бременских музыкантов.</span></p><p><strong style=\"background-color: rgb(35, 35, 36); color: rgb(201, 204, 207);\"><em>Комментарий:</em></strong><em style=\"background-color: rgb(35, 35, 36); color: rgb(201, 204, 207);\">&nbsp;в состав бременских музыкантов из советского мультфильма 1969 года входили: птица, человек и три животных, одно из которых было лошадью.</em></p><p><br></p><p><br></p><h2><span style=\"background-color: rgb(35, 35, 36); color: rgb(201, 204, 207);\">Вопрос №2</span></h2><p><img src=\"data:image/png;base64,\"></p><p><br></p><p><span style=\"background-color: rgb(35, 35, 36); color: rgb(201, 204, 207);\">Однажды Пер Гессле, гитарист Roxette пошутил: приятно, черт возьми, что вся Швеция облизывает мой зад.</span></p><p><span style=\"background-color: rgb(35, 35, 36); color: rgb(201, 204, 207);\">Выпуск чего послужил поводом для этой шутки?</span></p><p><br></p><p><strong style=\"background-color: rgb(35, 35, 36); color: rgb(201, 204, 207);\">Ответ:</strong></p><p><span style=\"background-color: rgb(35, 35, 36); color: rgb(201, 204, 207);\">Почтовых марок с изображением группы.</span></p><p><br></p><p><br></p><h2><span style=\"background-color: rgb(35, 35, 36); color: rgb(201, 204, 207);\">Вопрос №3</span></h2><p><img src=\"data:image/png;base64,\"></p><p><br></p><p><span style=\"background-color: rgb(35, 35, 36); color: rgb(201, 204, 207);\">Рэпер 6ix9ine известен тем, что давал показания против людей, с которыми состоял в одной банде, чем, разумеется, вызвал их гнев.</span></p><p><span style=\"background-color: rgb(35, 35, 36); color: rgb(201, 204, 207);\">Глядя на артиста, многие СМИ обсуждали вопрос о том, как, интересно, в этом случае будет работать ОНА.</span></p><p><span style=\"background-color: rgb(35, 35, 36); color: rgb(201, 204, 207);\">Назовите ЕЁ.</span></p><p><br></p><p><strong style=\"background-color: rgb(35, 35, 36); color: rgb(201, 204, 207);\">Ответ:</strong></p><p><span style=\"background-color: rgb(35, 35, 36); color: rgb(201, 204, 207);\">Программа по защите свидетелей.</span></p><p><strong style=\"background-color: rgb(35, 35, 36); color: rgb(201, 204, 207);\"><em>Комментарий:</em></strong><em style=\"background-color: rgb(35, 35, 36); color: rgb(201, 204, 207);\">&nbsp;на теле Текаши около 70 татуировок, часть из них — на лице, включая крупное число 69 на лбу. Удаление татуировок лазером достаточное дорогая, болезненная и не самая эффективная процедура, поэтому изменение личности рэпера представляется затруднительной задачей.</em></p><p><br></p>', '2024-05-27 10:53:38');
INSERT INTO `articles` (`id`, `category_id`, `title`, `image_path`, `description`, `content`, `created_time`) VALUES
(27, 4, 'В России открыли первый в стране государственный центр киберспорта — занятия в нём бесплатные ', '1716807396923-d1d600ec-68e0-47f0-9faa-e124722f4528.jpg', 'Он рассчитан на детей старше 10 лет.', '<p><span style=\"background-color: rgb(35, 35, 36); color: rgb(201, 204, 207);\">Первый в России государственный центр киберспорта начал работу в Санкт-Петербурге. В открытии площадки принял участие губернатор города Александр Беглов. Об этом&nbsp;</span><a href=\"https://www.gov.spb.ru/press/governor/280049/\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"background-color: transparent; color: var(--theme-color-signal-active-default);\">сообщили</a><span style=\"background-color: rgb(35, 35, 36); color: rgb(201, 204, 207);\">&nbsp;в пресс-службе Северной столицы.</span></p><p><span style=\"background-color: rgb(35, 35, 36); color: rgb(201, 204, 207);\">Центр киберспорта рассчитан на детей старше 10 лет, в том числе из многодетных и малообеспеченных семей, а также сирот. Беглов подчеркнул, что, поскольку площадка государственная, то тренировки будут бесплатными.</span></p><p><br></p><blockquote><span style=\"background-color: rgb(35, 35, 36); color: rgb(201, 204, 207);\">Мы впервые в стране создали такой центр киберспорта практически с нуля. Очень важно, что он не коммерческий, а городской. Здесь можно тренироваться абсолютно бесплатно. В прошлом году провели капитальный ремонт, закупили необходимое оборудование и мебель.</span></blockquote><blockquote><strong style=\"background-color: rgb(35, 35, 36); color: rgb(201, 204, 207);\">Александр Беглов</strong><span style=\"background-color: rgb(35, 35, 36); color: rgb(201, 204, 207);\">, губернатор Санкт-Петербурга</span></blockquote><p><br></p><p><span style=\"background-color: rgb(35, 35, 36); color: rgb(201, 204, 207);\">Центр включает в себя основной зал на 30 игровых мест со сценой и экраном, четыре зала для тренировок и два помещения для командных соревнований. На площадке организовали зону активного отдыха на 10 игровых мест, а также «стримерскую» для проведения трансляций. Центр оснащён компьютерной техникой «профессионального уровня» и актуальными консолями.</span></p><p><br></p><blockquote><span style=\"background-color: rgb(35, 35, 36); color: rgb(201, 204, 207);\">Такие центры приобщают ребят к высоким технологиям, профессиям цифровой экономики. Президентом поставлена задача – достижения технологического лидерства России. Для этого нужны кадры и воспитывать их нужно с раннего возраста.</span></blockquote><blockquote><strong style=\"background-color: rgb(35, 35, 36); color: rgb(201, 204, 207);\">Александр Беглов</strong><span style=\"background-color: rgb(35, 35, 36); color: rgb(201, 204, 207);\">, губернатор Санкт-Петербурга</span></blockquote><p><br></p><p><span style=\"background-color: rgb(35, 35, 36); color: rgb(201, 204, 207);\">В будущем на базе центра планируют открыть школу киберспорта для детей и подростков, а также спортивный клуб для подготовки более опытных кибератлетов к соревнованиям.</span></p><p><br></p><p><br></p><p><br></p>', '2024-05-27 10:56:36');

